import React from 'react';
import { useLocation } from 'react-router-dom';
import { useNavigate} from 'react-router-dom';

function ResultPage() {

   const navigate = useNavigate()
   const handleUpload = () => {
        navigate('/')
    }
    return (
      <div>
        <h1>処理完了</h1>
        <button onClick={handleUpload}>アップロード画面へ</button>
      </div>
    );
  }
  
  export default ResultPage;
